    messagingSenderId: "335347869763",
    appId: "1:335347869763:web:305cc1caca5a87d3940cf6",
    measurementId: "G-6ZXJGSE7GM",
  };
  initializeApp(firebaseConfig);



  // function requestPermission() {
  //   console.log("Requesting permission...");
